import { Link } from "react-router-dom";
function Users() {
    return (

        <div classNameName="container-fluid mt--6">
            <div className="row">
                <div className="col">
                    <div className="card">

                        <div className="table-responsive mt-4" id="show_all_users">

                        </div>

                    </div>
                </div>
            </div>
        </div>
    );
}

export default Users;
